import styled from "styled-components";
import { colors, rawColors } from "../locales/colors";

export const MainMenuBox = styled.div`
  background-color: ${colors.bg};
  height: 200px;
  width: 20%;
  position: absolute;
  right: 40px;
  box-shadow: 0px 0px 0px 1px ${rawColors.green1_300} inset;
`;
